B.Dd=new A.f7("text_recognition","Real time text recognition","This project was an attempt to build a library using ML Kit to scan Australian identity documents directly on the local device, without relying on external services.The main challenge was...","text_recognition_label.png","text_recognition_label.png","This project was an attempt to build a library using ML Kit to scan Australian identity documents directly on the local device, without relying on external services.\n\nThe main challenge was data filtering: each scan can generate hundreds or even thousands of character groups. While document formats are standardized, the actual data varies significantly\u2014for example, one person may have a single name, while another may have three or four. To address this, we implemented a probability-based validation function that analyzes multiple scan attempts and selects the most frequently occurring variant as the most likely correct result.",null)
B.Dg=new A.f7("led_matrix_backpack","Custom wifi led matrix backpack","This is a mini project where I built a 16\xd716 LED matrix with individually controlled LEDs. The primary goal was to mount the matrix on a backpack and control it through a mobile app capable...","led_matrix_schema.png","test_image.jpg","This is a mini project where I built a 16\xd716 LED matrix with individually controlled LEDs. The primary goal was to mount the matrix on a backpack and control it through a mobile app capable of displaying various images and animations in 16-bit format.\n\nFor the controller, I used a Wemos Mini D1, chosen for its compact size, sufficient memory, and built-in Wi-Fi module, which enables control via a local Wi-Fi network. To stabilize the signal, I included a 220-ohm resistor and a 470\xb5F capacitor, while brightness detection was handled with a photoresistor. Power can be supplied by any 5V source with an output of 3\u20135A; in my case, I used a standard power bank. Initially, I experimented with adding a speaker, but it was later removed during development.\n\nThe LED matrix supports several features, including freehand drawing, image uploading, text display, animated effects using GIFs, and even small games such as Snake, Tetris, and Runner.","Ww2GTVFeY4k")
B.Df=new A.f7("math_mini_game","Kotlin math mini game","A mini-project built in Kotlin to practice OOP principles and explore Android-specific tools such as fragments, view binding, and Jetpack Navigation.The app is a simple math puzzle game with multiple...","kotlin_mini_math_game_label.png","kotlin_math_mini_game_description.png","A mini-project built in Kotlin to practice OOP principles and explore Android-specific tools such as fragments, view binding, and Jetpack Navigation.\n\nThe app is a simple math puzzle game with multiple difficulty levels. Players must pick one of six randomly generated digits to complete the target sum. Difficulty settings control the time limit, required correct answers, and sum complexity.\n\nTo ensure fair play, the game also tracks the accuracy ratio (correct vs. incorrect answers), preventing users from progressing by repeatedly selecting the same option.",null)
